import { Row, Col, Button } from "react-bootstrap";
import "./searchEngine.css";
import { connect } from "react-redux";
const mapStateToProps = (state) => state;
class Weather extends Component {
  state = {
    textForSearch: "",
    nextFiveDays:[]
  };
  addNextFiveDays = () => {
      this.setState({nextFiveDays:this.state.nextFiveDays.concat(this.props.currentWeather.weather.list[0])});
      this.setState({nextFiveDays:this.state.nextFiveDays.concat(this.props.currentWeather.weather.list[7])});
      this.setState({nextFiveDays:this.state.nextFiveDays.concat(this.props.currentWeather.weather.list[14])});
      this.setState({nextFiveDays:this.state.nextFiveDays.concat(this.props.currentWeather.weather.list[21])});
      this.setState({nextFiveDays:this.state.nextFiveDays.concat(this.props.currentWeather.weather.list[28])});
  }
  componentDidMount = () => {
      this.addNextFiveDays()
  }
